import React from 'react';
import ResumeForm from './components/ResumeForm';
import './index.css';
import { FaUser, FaBriefcase, FaGraduationCap, FaTools } from 'react-icons/fa';
import { FiEdit } from 'react-icons/fi';

function App() {
  return (
    <div className="min-h-screen bg-gray-100">
      {/* Sticky Navbar with Icons */}
      <nav className="sticky top-0 bg-white shadow z-50 py-3 px-6 flex justify-center gap-8">
        <a href="#name" className="flex items-center text-blue-600 font-medium hover:underline gap-1">
          <FaUser /> Name
        </a>
        <a href="#experience" className="flex items-center text-blue-600 font-medium hover:underline gap-1">
          <FaBriefcase /> Experience
        </a>
        <a href="#education" className="flex items-center text-blue-600 font-medium hover:underline gap-1">
          <FaGraduationCap /> Education
        </a>
        <a href="#skills" className="flex items-center text-blue-600 font-medium hover:underline gap-1">
          <FaTools /> Skills
        </a>
      </nav>

      <div className="max-w-4xl mx-auto bg-white shadow-lg rounded-lg p-6 mt-6">
        {/* Heading with Icon */}
        <h1 className="text-4xl font-bold text-center text-blue-600 mb-6 flex justify-center items-center gap-3">
          <FiEdit className="text-blue-500 w-8 h-8" />
          Resume Editor
        </h1>

        <ResumeForm />
      </div>
    </div>
  );
}

export default App;
